import React from "react";

import { makeStyles, Paper } from "@material-ui/core";

export const ContactList = ({ contacts }) => {
  return (
    <div>
      {contacts.map((contact) => (
        <p key={contact.id}>{`${contact.firstName} ${contact.lastName}`}</p>
      ))}
    </div>
  );
};
